pub unsafe fn memset(
    ptr: *mut libc::c_void,
    constant: libc::c_int,
    size: usize,
) -> *mut libc::c_void {
    core::ptr::write_bytes(ptr as *mut u8, constant as u8, size);
    ptr
}

pub unsafe fn memcpy(
    dst: *mut libc::c_void,
    src: *const libc::c_void,
    size: usize,
) -> *mut libc::c_void {
    core::ptr::copy_nonoverlapping(src as *const u8, dst as *mut u8, size);
    dst
}

