    let mut overflow: libc::c_int = 0 as libc::c_int;
    let mut res: secp256k1_gej = secp256k1_gej {
        x: secp256k1_fe {
            n: [0; 5],
            magnitude: 0,
            normalized: 0,
        },
        y: secp256k1_fe {
            n: [0; 5],
            magnitude: 0,
            normalized: 0,
        },
        z: secp256k1_fe {
            n: [0; 5],
            magnitude: 0,
            normalized: 0,
        },
        infinity: 0,
    };
    let mut pt: secp256k1_ge = secp256k1_ge {
        x: secp256k1_fe {
            n: [0; 5],
            magnitude: 0,
            normalized: 0,
        },
        y: secp256k1_fe {
            n: [0; 5],
            magnitude: 0,
            normalized: 0,
        },
        infinity: 0,
    };
    let mut s: secp256k1_scalar = secp256k1_scalar { d: [0; 4] };
