        fprintf(
            stderr,
            b"%s:%d: %s\n\x00" as *const u8 as *const libc::c_char,
            b"./src/modules/ecdh/main_impl.h\x00" as *const u8 as *const libc::c_char,
            35 as libc::c_int,
            b"test condition failed: ctx != NULL\x00" as *const u8 as *const libc::c_char,
        );
        panic!();
